import Link from "next/link";

const About = () => {
  return (
    <div>
      <ul>
        <li>
          <Link href="/">
            <a>Home</a>
          </Link>
        </li>
        <li>
          <Link href="/about">
            <a>About</a>
          </Link>
        </li>
      </ul>
      <h1>About To Do App</h1>
      <p>Simple todo app by Jericho Aldemo</p>
    </div>
  );
};

export default About;
